package 入门1顺序结构;

import java.util.Scanner;

//P1001
//输入两个整数 a,b，输出它们的和（OaO,ObO≤109）。
public class APlusB_Problem {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner cin = new Scanner(System.in);
		int a = cin.nextInt();
		int b = cin.nextInt();
		System.out.print(a + b);
	}

}
